            isLoaded: false,
            error: null,
        };
    }

    componentDidMount() {
        console.log('I was triggered during componentDidMount')
        fetch("https://window-drop-falcon2212.cloud.okteto.net/")
            .then(res => res.json())
            .then((res) => {
                this.setState({isLoaded: true,});
                console.log(res);
            })
            .catch((err)=>{
                this.setState({isLoaded: true, error: err});
                console.log('fuck')
                console.log(err);
            });
    }

